def minimumAbsDifference(arr):
    diff_dict = {}
    min_diff = 999999999999
    output =[]
    for num1 in sorted(arr):
        for num2 in sorted(arr):
            key = tuple(sorted((num1,num2)))
            if num1 != num2 and key not in diff_dict.keys():
                diff = abs(num1 - num2)
                diff_dict[key]= diff
                if diff < min_diff:
                    min_diff = diff
    for key, value in diff_dict.items():
        if value == min_diff:
            output.append(list(key))
    return output

